column8:
全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)自動車用映像分配機<br>
<br>
モニターの多い車には必需品<br>
最高で4つのモニターに接続可能<br>
<br>
入力電圧：DC12V<br>
ビデオ入力レベル：2.0Vpp<br>
ビデオ出力レベル：0.5～1.5Vpp<br>
出力インピーダンス：75Ω<br>
サイズ：約104×74×20mm<br>
配線：約300mm<br>
付属品：電源ケーブル、英語取扱説明書<br>
※大量輸入のため、小さいすり傷がある場合があります<br>
※取り付け前には、動作確認を行って下さい<br>
※取り付けのサポートは行っておりません<br>
